import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import DeliveryBoyPage from "./components/DeliveryBoyPage";

const App = () => {
  return (
    <Router>
      <Switch>
        <Route path="/" exact component={DeliveryBoyPage} />
      </Switch>
    </Router>
  );
};

export default App;
